import {useRef, React, useState} from 'react';
import * as style from "../../css/light/indexMenu";

export default function IndexMenu(props) {
  const [styleType] = useState(style)
  const [macStyle] = useState(styleType.macStyle)
  const [liStyle] = useState(styleType.liStyle)
  const liRef = useRef([])

  const createIndex = (name, type) => {
    if (type === props.index1[1]) return <div type={type} style={macStyle} ref={e => (liRef.current = [...liRef.current, e])}>{name}</div>
    else return <div type={type} style={liStyle} ref={e => (liRef.current = [...liRef.current, e])}>{name}</div>
  }

  const renderIndexOther = () => {
    return props.index.map((item, i) => (
      <div>
        {createIndex[item[0]], item[1]}
      </div>
    ))
  }

  return (
    <div style={style.containerStyle}>
      <div style={style.containerMainStyle}>
        {/* {createIndex(props.index1[0], props.index1[1])} */}
      </div>
      <div style={style.indexStyle}>
        {renderIndexOther()}
      </div>
    </div>
  )
}
